import React from 'react';
import './assets/css/Workspace.scss'

class Workspace extends React.Component {

    generate_component = () => {
        const path = "./Test";
        const Test = require(path)
        return(
            <Test />
        )
    }

    render() {
        return (
            <div className={"workspace"}>
                {this.generate_component()}
            </div>
        )
    };
}

export default Workspace;
